import React from 'react';
import Header from './../components/shared/Header'
import BaseLayout from './../components/layouts/BaseLayout'




class About extends React.Component {
  render() {
    return (
      <BaseLayout>
      <h1> I am About Page </h1>
      <Header/>
      </BaseLayout>
    )
  }
}

export default About;
